import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ShopOwnerService {
  gethopowner: any;
  getshopowner() {
    throw new Error('Method not implemented.');
  }
  API = "http://localhost:8066";

  constructor(private http: HttpClient) {}

  // Register a new ShopOwner
  public registerShopOwner(ShopOwnerData: any) {
    return this.http.post(`${this.API}/shopowner`, ShopOwnerData); // Adjusted to match backend endpoint
  }

  // Get all orders
  public getShopOwner() {
    return this.http.get(`${this.API}/shopowenr`); // Adjusted to match backend endpoint
  }

  // Delete an order by ID
  public deleteShopOwner(id: number) {

    return this.http.delete(`${this.API}/shopowner/${id}`); // Adjusted to match backend endpoint
  }

  // Update an order
  public updateShopOwner(shopowner: any) {
    const id = shopowner.id || shopowner.id; // Ensure compatibility
    return this.http.put(`${this.API}/shopowner/${id}`, shopowner); // Adjusted to match backend endpoint
  }
}
